import React from "react";
import "./App.css";

function App() {
  const emojis = [
    "😁",
    "😂",
    "😃",
    "😄",
    "😂",
    "😃",
    "😄",
    "😅",
    "😆",
    "😅",
    "😆",
    "😁"
  ];
  const cards = emojis.map(i => {
    return <Card emoji={i} />;
  });
  return <div className="App">This is AIT homework 08.</div>;
}

export default App;
